import base64
import json
from lxml import etree
import re


def crack_captcha(data):
    model = ""
    model = json.loads(base64.b64decode(model))

    # data = data.split('base64,')[-1]
    # data = base64.b64decode(data).decode('utf-8')
    root = etree.fromstring(data)

    # Remove Element
    for elem in root:
        if 'stroke' in elem.attrib:
            root.remove(elem)
    dees = []
    for elem in root:
        dees.append(elem.attrib['d'])

    eks_dees = sorted([int(dee.split(".")[0].replace("M", "")) for dee in dees])
    combo_dees = [[eks_dee, dee] for eks_dee in eks_dees for dee in dees if
                  str(eks_dee) == dee.split('.')[0].replace('M', '')]
    final_string = ''.join([model[re.sub('[\d\.\s]', '', combo_dee[1])] for combo_dee in combo_dees])
    return final_string
